import { useNavigate } from 'react-router-dom';

function LogoutButton() {
  const nav = useNavigate();
  const logout = () => {
    localStorage.removeItem('token');
    nav('/login');
  };

  return <button onClick={logout} className="btn btn-outline-danger">Sair</button>;
}
